    public static List<long> Factorize(long n) {
        List<long> result = new List<long>();
        List<long> factors = new List<long>();
        long[] factorsArray = new long[n];
        for (int I = 2; I <= n; i++) {
            if (n % i == 0) {
                factorsArray[i] = i;
                factors.Add(i);
            }
        }
        for (int I = 1; I <= n; i++) {
            if (factorsArray[i] != 1) {
