                    if (factors[j] % i == 0) {
                        factors[j] /= i;
                        factors.RemoveAt(j);
                        break;
                    }
                }
            }
        }
        for (int I = 0; I < factors.Count; i++) {
            if (factors[i] != 1) {
                result.Add(factors[i]);
            }
        }
        return result;

