class Problem {
    // <func> // C#
// Given an integer. return a tuple that has the number of even and odd digits respectively.
    // Example:
    // >>> EvenOddCount((-12L))
    // (Tuple.Create(1L, 1L))
    // >>> EvenOddCount((123L))
    // (Tuple.Create(1L, 2L))
    public static Tuple<long, long> EvenOddCount(long num) {
        long even = 0;
        long odd = 0;
        for (int i = 0; i < num; i++) {
            if (num % 2 == 0) {
                even++;
            }
            else {
                odd++;
            }
        }
        return Tuple.Create(even, odd);

