    // <func> // C#
// Given the lengths of the three sides of a triangle. Return true if the three
    // sides form a right-angled triangle, false otherwise.
    // A right-angled triangle is a triangle in which one angle is right angle or 
    // 90 degree.
    // Example:
    // >>> RightAngleTriangle((3L), (4L), (5L))
    // (true)
    // >>> RightAngleTriangle((1L), (2L), (3L))
    // (false)
    public static bool RightAngleTriangle(long a, long b, long c) {
        if (a == b && b == c) {
            return true;
        }
        if (a > b && a > c) {
            return RightAngleTriangle(b, c, a);
        }
        if (b > c && b > a) {
            return RightAngleTriangle(a, c, b);
        }
        if (c > a && c > b) {
            return RightAngleTriangle(a, b, c);
        }
        return false;

