    // >>> FindMax((new List<string>(new string[]{(string)"aaaaaaa", (string)"bb", (string)"cc"})))
    // ("aaaaaaa")
    public static string FindMax(List<string> words) {
        string max = "";
        int maxLength = 0;
        foreach (string word in words) {
            int length = word.Length;
            if (length > maxLength) {
                max = word;
                maxLength = length;
            }
        }
        return max;

